import React, { Component } from 'react';
import Select from 'react-select';

const options = [
    { value: 'chocolate', label: 'Chocolate' },
    { value: 'strawberry', label: 'Strawberry' },
    { value: 'vanilla', label: 'Vanilla' },
  ];

export default class Dispatchcc extends Component {
    state = {
        selectedOption: null,
      };

      handleChange = (selectedOption) => {
        this.setState({ selectedOption }, () =>
          console.log(`Option selected:`, this.state.selectedOption)
        );
      };
    render() {
        const { selectedOption } = this.state;
        return (
            <div className="mx-auto shadow mt-5 py-3">
                
                    
                <div class="container py-2" style={{backgroundColor:'red'}}>
                <div class="float-right">
                    <button type="button" class="btn btn-danger btn-lg float-right">Generate DC</button>
                </div><br/><br/><br/>
                    <div class="row">
                        <div class="col-sm-4">
                        <Select
                            value={selectedOption}
                            onChange={this.handleChange}
                            options={options}
                        />
                        </div>
                        <div class="col-sm-4">
                        <Select
                            value={selectedOption}
                            onChange={this.handleChange}
                            options={options}
                        />
                        </div>
                        <div class="col-sm-4">
                        <Select
                            value={selectedOption}
                            onChange={this.handleChange}
                            options={options}
                        />
                        </div>
                    </div>
                </div>
                
                <div className="mt-3">
                    <table class="table table-bordered">
                        <thead class="thead-dark">
                            <tr>
                                <th scope="col"><input type="checkbox"/></th>
                                <th scope="col">IC Number</th>
                                <th scope="col">PO Number</th>
                                <th scope="col">PO Line Item Number</th>
                                <th scope="col">IC qty</th>
                                <th scope="col">Qty Already Issued DC</th>
                                <th scope="col">Balance Qty available for DC</th>
                                <th scope="col">Present DC</th>
                                <th scope="col">Remaining</th>
                                <th scope="col">Bill Scheduling Number</th>
                            </tr>
                        </thead>
                        <tbody>
                            <tr>
                                <th scope="row"><input type="checkbox"/></th>
                                <td>123-1</td>
                                <td>10</td>
                                <td>100</td>
                                <td>0</td>
                                <td>100</td>
                                <td>50</td>
                                <td><input type="number" class="form-control" aria-describedby="present" placeholder="DC"/></td>
                                <td>=</td>
                            </tr>
                        </tbody>
                    </table>
                </div>

            </div>

        )
    }
}
